import React from 'react';
import Header from './Header.jsx';

function AdminFeature(){
    return (
        <div>
            <Header />
            <h1>Administrator Feature Assignment</h1>
            <form>
                <div class="form-group row"></div>
                <label>Photo: </label>
                <input class="form-control" type="text" placeholder="paste photo url here"></input>
                <label>Feature Title: </label>
                <input class="form-control" type="text" placeholder="type the title of the feature here" />
                <button type="submit">Submit</button>
            </form>
        </div>
    );
}

export default AdminFeature;
